INSERT INTO `srs` (`id`, `systemProspect`, `scope`, `objectives`, `definitions`, `referencs`, `globalAppraisal`, `productPerspective`, `interfaces`, `userCharacteristics`, `productFunctions`, `domainModel`, `restrictions`, `suppositions`, `dbRequirements`, `designRestrictions`, `ruleAcceptance`, `projectId`, `version`) VALUES
(1, 'El software por desarrollar tiene como propÃ???????Ã??????Ã?????Ã????Ã???Ã??Ã?Â³sito generar el brindar una herramienta para la creaciÃ???????Ã??????Ã?????Ã????Ã???Ã??Ã?Â³n de un documento SRS. En este se le va a pedir al usuario que escriba una serie de requerimientos, junto con los atributos del documento para al final crear el documento final con manejos de versiones.\r\nEl sistema sirve para ayudar a los desarrolladores a poder manejar una plantilla estÃ???????Ã??????Ã?????Ã????Ã???Ã??Ã?Â¡ndar para la creaciÃ???????Ã??????Ã?????Ã????Ã???Ã??Ã?Â³n de este documento, y asÃ???????Ã??????Ã?????Ã????Ã???Ã??Ã?Â­ tener confianza de que el documento generado al final tiene todos los campos obligatorios y necesarios. \r\nEl sistema se divide en diferentes mÃ???????Ã??????Ã?????Ã????Ã???Ã??Ã?Â³dulos que separan la parte lÃ???????Ã??????Ã?????Ã????Ã???Ã??Ã?Â³gica de la parte visual del sistema. Esto se da para crear un ambiente completo y lo mÃ???????Ã??????Ã?????Ã????Ã???Ã??Ã?Â¡s intuitivo posible para el usuario. La construcciÃ???????Ã??????Ã?????Ã????Ã???Ã??Ã?Â³n del sistema se realiza acorde a los requisitos (tanto funcionales como no funcionales) del sistema, sin embargo algunos presentan mÃ???????Ã??????Ã?????Ã????Ã???Ã??Ã?Â¡s prioridad que otros. Dentro de los requisitos funcionales se tiene mayor prioridad en todos los requerimientos que se relacionen directamente con la creaciÃ???????Ã??????Ã?????Ã????Ã???Ã??Ã?Â³n del documento SRS, es decir: crear proyecto, crear requisitos, crear documento, entre otrosÃ??????Ã?????Ã????Ã???Ã??Ã?Â¢?Ã??????Ã?????Ã????Ã???Ã??Ã?Â¦\r\nEn los requisitos no funcionales se le da mayor prioridad a la escalabilidad, la disponibilidad, la seguridad y la usabilidad sobre los otros requisitos no funcionales tambiÃ???????Ã??????Ã?????Ã????Ã???Ã??Ã?Â©n definidos (mantenimiento, portabilidad y eficiencia). 	\r\nEl sistema se construye para dar respuesta a la necesidad del cliente de crear un software capaz de generar el documento SRS a partir de ciertos parÃ???????Ã??????Ã?????Ã????Ã???Ã??Ã?Â¡metros. \r\n', 'a. El software tiene un alcance limitado, solo se centra en la creaciÃ???????Ã??????Ã?????Ã????Ã???Ã??Ã?Â³n de las especificaciones de los requerimientos.\r\nb. No se debe utilizar como una herramienta de metodologÃ???????Ã??????Ã?????Ã????Ã???Ã??Ã?Â­a.\r\nc. Al final genera un documento SRS, como este.\r\n', 'El proyecto se desarrolla con el objetivo de brindar a los usuarios una herramienta que les permita gestionar la parte referente a los requisitos en sus propios proyectos.  El objetivo es que el sistema cumpla con la funcionalidad esperada y ademÃ???????Ã??????Ã?????Ã????Ã???Ã??Ã?Â¡s sea fÃ???????Ã??????Ã?????Ã????Ã???Ã??Ã?Â¡cil de usar y agradable a la vista, para ello se propone un marco de diseÃ???????Ã??????Ã?????Ã????Ã???Ã??Ã?Â±o adecuado y acorde con los gustos del cliente. Adicionalmente el sistema no debe de exceder el lÃ???????Ã??????Ã?????Ã????Ã???Ã??Ã?Â­mite de tiempo de respuesta establecido y elementos como requisitos y especificaciones deben tener trazabilidad.', 'SRS = Software Requirements Specification.\r\nUsuario = Papel que tienen las personas que van a interactuar con la pÃ???????Ã??????Ã?????Ã????Ã???Ã??Ã?Â¡gina Web.\r\nStakeholder = Hace referencia a una persona, organizaciÃ???????Ã??????Ã?????Ã????Ã???Ã??Ã?Â³n o empresa que tiene interÃ???????Ã??????Ã?????Ã????Ã???Ã??Ã?Â©s en una empresa, organizaciÃ???????Ã??????Ã?????Ã????Ã???Ã??Ã?Â³n dada o sistema.\r\nHistoria de Usuario= Herramienta usada en las metodologÃ???????Ã??????Ã?????Ã????Ã???Ã??Ã?Â­as Ã???????Ã??????Ã?????Ã????Ã???Ã??Ã?Â¡giles para captar la descripciÃ???????Ã??????Ã?????Ã????Ã???Ã??Ã?Â³n de una caracterÃ???????Ã??????Ã?????Ã????Ã???Ã??Ã?Â­stica del software desde la perspectiva del usuario.\r\nModelo del dominio = SinÃ???????Ã??????Ã?????Ã????Ã???Ã??Ã?Â³nimo de diagrama de contexto.\r\n\r\nRequerimientos Funcionales= Son aquellos que describen cualquier actividad que este deba realizar, en otras palabras, el comportamiento o funciÃ???????Ã??????Ã?????Ã????Ã???Ã??Ã?Â³n particular de un sistema o software cuando se cumplen ciertas condiciones.\r\nRequerimientos no Funcionales= Son las restricciones o condiciones que impone el cliente al programa que necesita, por ejemplo el tiempo de entrega del programa, el lenguaje o la cantidad de usuarios.\r\n', 'null', 'El software va a funcionar como herramienta para facilitar la generaciÃ???????Ã??????Ã?????Ã????Ã???Ã??Ã?Â³n de documentos SRS, es decir para la especificaciÃ???????Ã??????Ã?????Ã????Ã???Ã??Ã?Â³n de requisitos de futuros Software a desarrollar. \r\nVa a contar con todo lo necesario que va en una plantilla de documento SRS y al final de que los usuarios llenen toda la informaciÃ???????Ã??????Ã?????Ã????Ã???Ã??Ã?Â³n que quieren que vaya en el documento se va a generar de forma automÃ???????Ã??????Ã?????Ã????Ã???Ã??Ã?Â¡tica. TambiÃ???????Ã??????Ã?????Ã????Ã???Ã??Ã?Â©n contarÃ???????Ã??????Ã?????Ã????Ã???Ã??Ã?Â¡ con toda la secciÃ???????Ã??????Ã?????Ã????Ã???Ã??Ã?Â³n de especificaciÃ???????Ã??????Ã?????Ã????Ã???Ã??Ã?Â³n de requisitos, donde se podrÃ???????Ã??????Ã?????Ã????Ã???Ã??Ã?Â¡n sacar nuevas versiones de estos y el software automÃ???????Ã??????Ã?????Ã????Ã???Ã??Ã?Â¡ticamente escoge la Ã???????Ã??????Ã?????Ã????Ã???Ã??Ã?Âºltima versiÃ???????Ã??????Ã?????Ã????Ã???Ã??Ã?Â³n del requisito para aÃ???????Ã??????Ã?????Ã????Ã???Ã??Ã?Â±adir al documento final.\r\n', 'El producto para desarrollar tiene similitud con otros Softwares ya creados, tales como: SPARX, DOORS, inflectra, trello, Modern requirements, Accompa, Visure Solutions y Blueprint. Sin embargo, estos Software ya creados estÃ?Â¡n mÃ?Â¡s globalizados. No se enfocan solo en la parte de especificaciÃ?Â³n de requisitos, sino que tratan todo el proyecto como la metodologÃ?Â­a, las historias de usuario, entre otros. La funcionalidad de SIGERE es mÃ?Â¡s restringida. \r\n', 'null', 'Los usuarios del sistema se caracterizan por tener un conocimiento previo en ingenierÃ?Â­a de requisitos, deben saber cÃ?Â³mo manejar y relacionar requisitos, especificaciones y diagramas. Deben estar conscientes que el proceso de definiciÃ?Â³n de requisitos, de especificarlos y plasmarlos en diagramas forma parte de un proceso mÃ?Â¡s grande que sigue una metodologÃ?Â­a, entonces todo lo que se haga tiene un propÃ?Â³sito que perdurarÃ?Â¡ en el desarrollo del proyecto. Por lo anterior es preferible que hayan tenido experiencias trabajando con la metodologÃ?Â­a de desarrollo RUP.\r\n\r\nEn el sistema se harÃ?Â¡ la diferenciaciÃ?Â³n entre tres tipos de usuarios dentro de cada proyecto:\r\n\r\n- Administrador: Se entiende como el usuario que creÃ?Â³ el proyecto, por lo tanto puede borrarlo si asÃ?Â­ lo desea. TambiÃ?Â©n es quien aÃ?Â±ade integrantes al proyecto y define su rol. Cabe resaltar que el administrador puede crear requerimientos, especificaciones, subir diagramas, editar campos del documento SRS, crear eventos, dejar notas en el chat del proyecto y generar SRS.\r\n- Participante: Las posibles acciones de un participante incluyen crear requerimientos, especificaciones, subir diagramas, editar campos del documento SRS, crear eventos, dejar notas en el chat del proyecto y generar SRS.\r\n- Observador: Este usuario es agregado al proyecto pero dentro de este solo podrÃ?Â¡ ver el contenido que los participantes y el administrador suben. \r\n', 'El sistema es una herramienta que permite definir, gestionar y visualizar requisitos. En general sus funciones son las siguientes:\r\n\r\n- Proyectos \r\nLos usuarios podrÃ?Â¡n crear cuentos proyectos deseen y decidir que otros usuarios podrÃ?Â¡n acceder a ellos.\r\n- Requisitos\r\nUna vez trabajando en algÃ?Âºn proyecto, los integrantes podrÃ?Â¡n agregar requisitos y especificar en quÃ?Â© estado se encuentran (con relaciÃ?Â³n a la validez del mismo). Si ya existe el requisito, se puede crear otra versiÃ?Â³n de Ã?Â©l y esta se agrega al historial de versiones.\r\n- Especificaciones\r\nCuando ya se tengan requisitos creados los integrantes podrÃ?Â¡n asociar especificaciones a cada uno, un requisito puede tener una o varias especificaciones.\r\n- Diagramas\r\nLos integrantes del proyecto podrÃ?Â¡n cargar diagramas (en formatos de imagen) a la herramienta y decir cuÃ?Â¡les requisitos y/o especificaciones abarca.\r\n- Calendario\r\nTodos los proyectos tienen su propio calendario en el cual los integrantes pueden agregar eventos para que los demÃ?Â¡s los vean.\r\n- SRS\r\nTal vez la funciÃ?Â³n mÃ?Â¡s importante del sistema. DespuÃ?Â©s de tener un proyecto lo suficientemente completo, se puede generar automÃ?Â¡ticamente un documento SRS. TambiÃ?Â©n se pueden generar varias versiones de este y todas las versiones se podrÃ?Â¡n visualizar.\r\n', 'null', 'a) Las polÃ?Â­ticas reguladoras\r\nEl software se va a desarrollar mediante software de licencia abierta por lo que no se deberÃ?Â¡ pagar por el uso de los lenguajes de programaciÃ?Â³n, como Java, que se van a usar, siguiendo las polÃ?Â­ticas que imponen las organizaciones para el uso gratis de dichos lenguajes.\r\nb) Las limitaciones del hardware.\r\nNo hay limitaciones del Hardware por el momento.\r\nc) Las interfaces a otras aplicaciones.\r\nEs una pÃ?Â¡gina web autÃ?Â³noma por lo que necesita relacionarse con otras aplicaciones o pÃ?Â¡ginas.\r\nd) El funcionamiento paralelo.\r\nNo hay funcionamiento paralelo.\r\ne) Las funciones de auditorÃ?Â­a.\r\nNo hay funciones de auditorÃ?Â­a.\r\nf) Las funciones de control.\r\nEl sistema deberÃ?Â¡ controlar los permisos de los usuarios. Es decir, como por ejemplo, que sÃ?Â³lo los administradores puedan agregar o eliminar participantes a los proyectos.\r\ng) Los requisitos de lenguaje.\r\nTodo el material para el usuario, al igual que la plataforma deben estar en el lenguaje de espaÃ?Â±ol.\r\nh) Seguridad y consideraciones de seguridad.\r\nTodo lo referente a acceso de usuarios a la plataforma (inicio de sesiÃ?Â³n) deben estar almacenados en bases de datos. Por lo que el usuario solo podrÃ?Â¡ acceder a los proyectos una vez se haya verificado su identidad.\r\n', 'Las suposiciones y dependencias sobre las cuales se desarrollarÃ?Â¡ el sistema que pueden afectar los requerimientos especificados en el documento SRS son listados a continuaciÃ?Â³n:\r\n\r\nÃ¢?? Los requerimientos detallados en este documento han sido consolidados y aprobados por todos los stakeholders. Cualquier anexo o modificaciÃ?Â³n a los mismos, deberÃ?Â¡ ser aprobada en conjunto y comunicada a todas las partes implicadas en el proyecto.\r\nÃ¢?? La entrega del proyecto se realizarÃ?Â¡ en la Pontificia Universidad Javeriana Cali acompaÃ?Â±ado de una sustentaciÃ?Â³n y documentaciÃ?Â³n de este.\r\nEl sistema SIGERE funcionarÃ?Â¡ sin necesidad de comunicarse con sistemas externos, por lo que no hay dependencias con respecto a otros sistemas.	\r\n\r\n\r\n', 'El sistema se desarrollara mediante software de licencia abierta, es decir, que no se deberÃ¡ pagar por el uso de: El servidor web (Apache) y el sistema de gestiÃ³n de bases de datos MYSQL.\r\n<< Otros detalles aun no estÃ¡n especificados>>\r\n', 'No hay limitaciones Hardware por el momento. El lenguaje en el que se va a basar el proyecto principalmente es Java por lo que estarÃ¡ restringido por las bibliotecas y limitaciones que tenga dicho lenguaje de programaciÃ³n. 	\r\nSe utilizarÃ¡n las herramientas:\r\nEclipse: Como entorno de programaciÃ³n del lenguaje Java.\r\nTomcat: Como el servidor donde correrÃ¡ la pÃ¡gina web.\r\nXampp: Como gestor de bases de dato mysql.\r\n', 'El tipo de Software que se va a desarrollar no presenta requerimientos que deban acogerse a ninguna norma o restricciÃ³n judicial.', 3, '1.4'),
