s y dependencias sobre las cuales se desarrollarÃ¡ el sistema que pueden afectar los requerimientos especificados en el documento SRS son listados a continuaciÃ³n:\r\n\r\nâ?? Los requerimientos detallados en este documento han sido consolidados y aprobados por todos los stakeholders. Cualquier anexo o modificaciÃ³n a los mismos, deberÃ¡ ser aprobada en conjunto y comunicada a todas las partes implicadas en el proyecto.\r\nâ?? La entrega del proyecto se realizarÃ¡ en la Pontificia Universidad Javeriana Cali acompaÃ±ado de una sustentaciÃ³n y documentaciÃ³n de este.\r\nEl sistema SIGERE funcionarÃ¡ sin necesidad de comunicarse con sistemas externos, por lo que no hay dependencias con respecto a otros sistemas.	\r\n\r\n\r\n', 'El sistema se desarrollara mediante software de licencia abierta, es decir, que no se deberÃ¡ pagar por el uso de: El servidor web (Apache) y el sistema de gestiÃ³n de bases de datos MYSQL.\r\n<< Otros detalles aun no estÃ¡n especificados>>\r\n', 'No hay limitaciones Hardware por el momento. El lenguaje en el que se va a basar el proyecto principalmente es Java por lo que estarÃ¡ restringido por las bibliotecas y limitaciones que tenga dicho lenguaje de programaciÃ³n. 	\r\nSe utilizarÃ¡n las herramientas:\r\nEclipse: Como entorno de programaciÃ³n del lenguaje Java.\r\nTomcat: Como el servidor donde correrÃ¡ la pÃ¡gina web.\r\nXampp: Como gestor de bases de dato mysql.\r\n', 'El tipo de Software que se va a desarrollar no presenta requerimientos que deban acogerse a ninguna norma o restricciÃ³n judicial.', 3, '1.3');

